import React from 'react';
import logo from './logo.svg';
import './App.css';
import HomeBody from './homepage';
import MovieList from './movies';

function Nav() {
  return (
    <div>
      <img src="./JoelHiltonHeadshot.jpg" height="400" />
      <p>
        {' '}
        This site displays the movies curated by Joel Hilton and his impeccable
        taste.
      </p>
    </div>
  );
}

function App() {
  return (
    <div>
      <Nav />
      <HomeBody />
      <MovieList />
    </div>
  );
}

export default App;
